import './Include/css/Main.css';
import './css/Responsive.css';
import './css/Overall.css';

function Header() {
  return (
    <div>

        <div class="imp-message">
            It is only for the mobile
        </div>
        <main class="main-sectionWrapper">
            <div id="main-section" class="primary-scroll">

                <div class="modal fade " id="propertyCode-seller">
                    <div class="modal-dialog modal-dialog-centered">
                        <div class="modal-content">
                            <div class="modal-body">
                                <div class="modal-body__title">Enter Property Code to sell </div>
                                <form action="#" class="modal-body__form">
                                    <input type="text" placeholder="#1234456" />
                                    <a href="property.php" class="circle-arrow"><i class='bx bx-right-arrow-alt'></i></a>
                                </form>
                            </div>
                        </div>
                    </div>
                </div>

                <div class="modal fade " id="propertyCode-buyer">
                    <div class="modal-dialog modal-dialog-centered">
                        <div class="modal-content">
                            <div class="modal-body">
                                <div class="modal-body__title">Enter Property Code to sell </div>
                                <form action="#" class="modal-body__form">
                                    <input type="text" placeholder="#1234456" />
                                    <a href="../buyer/property.php" class="circle-arrow"><i class='bx bx-right-arrow-alt'></i></a>
                                </form>
                            </div>
                        </div>
                    </div>
                </div>

                <div class="modal fade" id="fingerPrint">
                    <div class="modal-dialog modal-dialog-centered">
                        <div class="modal-content">
                            <div class="modal-body text-center">
                                <button type="button" class="close" data-dismiss="modal">
                                    <span> <i class='bx bx-x'></i></span>
                                </button>
                                <div class="modal-body__title mb-0">This Functionality is in Process</div>
                            </div>
                        </div>
                    </div>
                </div>

            </div>
        </main>
    </div>
    );
  function appendScripts(scriptName) {
      const script = document.createElement("script");
      script.src = scriptName;
      document.body.appendChild(script);
    }
  window.addEventListener("load", function() {
      appendScripts("https://demo-designprojects.com/html/sigma-bank/js/bootstrap.min.js");
      appendScripts("https://demo-designprojects.com/html/sigma-bank/js/particles.js");
      appendScripts("https://demo-designprojects.com/html/sigma-bank/js/particles.min.js");
      appendScripts("https://demo-designprojects.com/html/sigma-bank/js/slick.js");
      appendScripts("https://demo-designprojects.com/html/sigma-bank/js/app.js");
    }); 
}
export default Header;
